import React, { Component } from 'react'

class SideBar extends Component {
    render() { 
        return(
            <div style={styles.sideBarStyle}>
            </div>
        )
    }
}

const styles = {
    sideBarStyle: {
        backgroundColor: 'white',
        height: '300px',
        borderRadius: 8,
        boxShadow: '0 10px 20px rgba(0,0,0,0.10), 0 6px 6px rgba(0,0,0,0.10)'
    }
}

export default SideBar
